import numpy as npimport h5pyimport pytestimport osimport iterator_pkgfrom iterator_pkg import DataSourcefrom iterator_pkg import KeyFollower#Check KeyFollower can translate a dictionary keypath and filepath pairs into a dictionary of key arraysdef test_iterates_complete_dataset():                filepath = "/Users/richardparke/Documents/Diamond/Iterator/tests/hdf5_tests/complete_2"      key_paths = ["keys/2"]      data_paths = ['data/2']      with h5py.File(filepath, "r") as f:          #data = f[key_paths[0]][...]           kf = DataSource.DataFollower(f, key_paths, data_paths, timeout = 1)           kf._get_frame_shape()           current_key = 0           for key in kf:               print(key)               print(len(key[0]))               current_key+= 1               print(current_key)                assert current_key == 10      print(current_key)        def test_iterates_incomplete_dataset():                filepath = "/Users/richardparke/Documents/Diamond/Iterator/tests/hdf5_tests/incomplete_2"      key_paths = ["keys/incomplete"]      data_paths = ["data/incomplete"]      with h5py.File(filepath, "r") as f:          #data = f[key_paths[0]][...]           kf = DataSource.DataFollower(f, key_paths, data_paths, timeout = 1)           kf._get_frame_shape()           current_key = 0           for key in kf:               print(key)               print(len(key[0]))               current_key+= 1               print(current_key)                assert current_key == 2      print(current_key)      def test_iterates_multiple_incomplete_dataset():                filepath = "/Users/richardparke/Documents/Diamond/Iterator/tests/hdf5_tests/incomplete_2"      key_paths = ["keys/complete", "keys/incomplete"]      data_paths = ['data/full', "data/incomplete"]      with h5py.File(filepath, "r") as f:          #data = f[key_paths[0]][...]           kf = DataSource.DataFollower(f, key_paths, data_paths, timeout = 1)           kf._get_frame_shape()           current_key = 0           for key in kf:               print(key)               print(len(key[0]))               current_key+= 1               print(current_key)                assert current_key == 2      print(current_key)        